/* eslint-disable import/no-commonjs, functional/immutable-data, functional/no-expression-statement */
module.exports = {
  plugins: ['functional', 'sonarjs', 'promise', 'import'],
  extends: [
    'algolia',
    'algolia/jest',
    'algolia/typescript',
    'plugin:functional/recommended',
    'plugin:sonarjs/recommended',
    'plugin:promise/recommended',
  ],
  rules: {
    'functional/no-conditional-statement': ['off'],
    'functional/functional-parameters': ['off'],
    '@typescript-eslint/explicit-function-return-type': ['off'],
    'valid-jsdoc': [
      'error',
      {
        requireReturnType: false,
        requireParamType: false,
      },
    ],
    'jsdoc/check-param-names': ['off'],
    'import/extensions': ['off'],
    'import/order': [
      'error',
      {
        alphabetize: {
          order: 'asc',
          caseInsensitive: true,
        },
        'newlines-between': 'always',
        groups: ['builtin', 'external', 'parent', 'sibling', 'index'],
        pathGroups: [
          {
            pattern: '@/**/*',
            group: 'parent',
            position: 'before',
          },
        ],
        pathGroupsExcludedImportTypes: ['builtin'],
      },
    ],
  },
  overrides: [
    {
      files: ['test/**/*'],
      rules: {
        'import/no-extraneous-dependencies': 'off',
      },
    },
    {
      files: ['scripts/**/*'],
      rules: {
        'no-void': 'off',
        'no-console': 'off',
        'no-process-exit': 'off',
        'functional/no-expression-statement': 'off',
        '@typescript-eslint/naming-convention': 'off',
        'jsdoc/require-description': 'off',
        'jsdoc/match-description': 'off',
        'valid-jsdoc': 'off',
      },
    },
    {
      files: ['**/__tests__/**'],
      rules: {
        'functional/no-expression-statement': ['off'],
        'import/no-extraneous-dependencies': ['off'],
        'sonarjs/no-duplicate-string': ['off'],
      },
    },
    {
      files: ['**/*.ts'],
      rules: {
        'no-undef': 'off',
      },
    },
  ],
  settings: {
    'import/parsers': {
      '@typescript-eslint/parser': ['.ts'],
    },
    'import/resolver': {
      typescript: {
        alwaysTryTypes: true,
      },
    },
  },
};

{
  "proseWrap": "never",
  "singleQuote": true,
  "trailingComma": "es5"
}

/* eslint-disable import/no-commonjs, functional/immutable-data, functional/no-expression-statement, @typescript-eslint/no-var-requires */
const wrapWarningWithDevCheck = require('./scripts/babel/wrap-warning-with-dev-check');

module.exports = (api) => {
  const isTest = api.env('test');
  const modules = isTest ? 'commonjs' : false;
  const targets = {};

  if (isTest) {
    targets.node = true;
  }

  return {
    presets: [
      '@babel/preset-typescript',
      [
        '@babel/preset-env',
        {
          modules,
          targets,
        },
      ],
    ],
    plugins: clean([
      '@babel/plugin-proposal-nullish-coalescing-operator',
      wrapWarningWithDevCheck,
      [
        'inline-replace-variables',
        {
          __DEV__: {
            type: 'node',
            replacement: "process.env.NODE_ENV !== 'production'",
          },
          __TEST__: {
            type: 'node',
            replacement: "process.env.NODE_ENV === 'test'",
          },
        },
      ],
    ]),
  };
};

function clean(config) {
  return config.filter(Boolean);
}

{
  "files": [
    {
      "path": "packages/calculator-bigint/dist/umd/index.production.js",
      "maxSize": "625 B"
    },
    {
      "path": "packages/calculator-number/dist/umd/index.production.js",
      "maxSize": "650 B"
    },
    {
      "path": "packages/core/dist/umd/index.production.js",
      "maxSize": "4 KB"
    },
    {
      "path": "packages/currencies/dist/umd/index.production.js",
      "maxSize": "1.5 KB"
    },
    {
      "path": "packages/dinero.js/dist/umd/index.production.js",
      "maxSize": "4.75 KB"
    }
  ]
}

/* eslint-disable @typescript-eslint/naming-convention */
declare const __DEV__: boolean;
declare const __TEST__: boolean;

export default {
  rootDir: './',
  clearMocks: true,
  coverageDirectory: 'coverage',
  testEnvironment: 'node',
  testPathIgnorePatterns: ['node_modules/', 'dist/'],
  coveragePathIgnorePatterns: ['node_modules/', 'dist/', 'test/'],
  watchPlugins: [
    'jest-watch-typeahead/filename',
    'jest-watch-typeahead/testname',
  ],
  globals: {
    __DEV__: true,
    __TEST__: true,
  },
  // This module mapper is for the Jest configurations in the `packages` folders
  // It is overridden by the top-level Jest configuration
  moduleNameMapper: {
    '^test-utils$': '<rootDir>/../../test/utils/',
    '^@dinero.js/(.*)$': '<rootDir>/../$1/src/',
    '^dinero.js$': '<rootDir>/../dinero.js/src/',
  },
  transform: {
    '\\.ts': ['babel-jest', { rootMode: 'upward' }],
  },
};

import base from './jest.base';

export default {
  ...base,
  moduleNameMapper: {
    '^test-utils$': '<rootDir>/test/utils/',
    '^@dinero.js/(.*)$': '<rootDir>/packages/$1/src/',
    '^dinero.js$': '<rootDir>/packages/dinero.js/src/',
  },
  projects: [
    '<rootDir>/packages/calculator-bigint/jest.config.ts',
    '<rootDir>/packages/calculator-number/jest.config.ts',
    '<rootDir>/packages/core/jest.config.ts',
    '<rootDir>/packages/currencies/jest.config.ts',
    '<rootDir>/packages/dinero.js/jest.config.ts',
  ],
};

/* eslint-disable import/no-commonjs, functional/immutable-data, functional/no-expression-statement */
module.exports = {
  '**/*.ts': () => 'yarn test:types',
  '!(website/)**/*.(js|mjs|ts|)': (filenames) =>
    `eslint --ext .js,.ts --fix ${filenames.join(' ')}`,
  'website/**/*.(js|jsx|ts|tsx)': () => `yarn --cwd website lint --fix`,
  '**/*.(js|mjs|jsx|ts|tsx)': (filenames) =>
    `yarn format ${filenames.join(' ')}`,
};

{
  "extends": [
    "config:js-lib",
    "schedule:monthly",
    ":semanticCommitTypeAll(chore)"
  ],
  "timezone": "Europe/Paris",
  "packageRules": [
    {
      "matchUpdateTypes": ["minor", "patch"],
      "matchCurrentVersion": "!/^0/",
      "automerge": true,
      "automergeType": "branch"
    }
  ]
}

/* eslint-disable import/no-commonjs, functional/no-expression-statement, functional/immutable-data */
module.exports = {
  monorepo: {
    mainVersionFile: 'package.json',
    packagesToBump: ['packages/*', 'website'],
    packagesToPublish: ['packages/*'],
  },
  publishCommand({ tag }) {
    return `yarn publish --access public --tag ${tag}`;
  },
  // Skip preparation if it contains only `chore` commits
  shouldPrepare({ releaseType, commitNumbersPerType }) {
    const { fix = 0 } = commitNumbersPerType;

    return releaseType !== 'patch' || fix !== 0;
  },
};

{
  "extends": "./tsconfig",
  "compilerOptions": {
    "emitDeclarationOnly": true,
    "composite": true,
    "incremental": true,
    "noEmit": false,
    "declaration": true
  }
}

{
  "$schema": "https://turborepo.org/schema.json",
  "pipeline": {
    "build:clean": {
      "cache": false
    },
    "build:definitions": {
      "dependsOn": ["^build:definitions"],
      "inputs": ["src/**/*.ts", "tsconfig.json"],
      "outputs": ["lib/**/*.d.ts"]
    },
    "build:types": {
      "dependsOn": ["^build:types", "build:definitions"],
      "inputs": ["lib/**/*.d.ts", "api-extractor.json"],
      "outputs": ["etc/**/*", "dist/esm/index.d.ts"]
    },
    "build:esm": {
      "dependsOn": [],
      "inputs": ["src/**/*.ts"],
      "outputs": ["dist/esm/**/*.js"]
    },
    "build:umd:cjs": {
      "dependsOn": ["build:esm"],
      "inputs": ["src/**/*.ts"],
      "outputs": ["dist/cjs/**/*.js", "dist/umd/**/*.js"]
    },
    "test": {
      "dependsOn": [],
      "inputs": ["src/**/*.ts", "jest.config.ts"],
      "outputs": []
    },
    "build": {
      "dependsOn": ["^build", "build:esm", "build:umd:cjs", "build:types"],
      "outputs": ["dist/**", ".next/**"]
    },
    "lint": {
      "inputs": ["**/*.ts", "**/*.js"],
      "outputs": []
    }
  },
  "globalDependencies": [
    ".eslintrc.js",
    ".prettierrc",
    "api-extractor.json",
    "babel.config.js",
    "bundlesize.config.json",
    "jest.base.ts",
    "jest.config.ts",
    "tsconfig.json",
    "tsconfig.declaration.json",
    "scripts/**/*"
  ]
}
